  text: "Quote:\r\n\t\r\n\t\r\n\t\t\r\n\t\t\t\r\n\t\t\t\t\r\n\t\t\t\t\tOriginally Posted by Da Qiao\r\n\t\t\t\t\t\r\n\t\t\t\t\r\n\t\t\t\tThấy các con hàng vật vã khổ sở quá nên ta làm phước qua bên kia search lại tí thông tin vậy, có điều qua bển mới thấy em này nổi từ hồi năm... 2008, hình như cũng sn 88 như ta, trước học RMIT.\r\nGoogle \"hoàng anh bambi\" nhóe, mấy cái hình ở top đầu là em ý đấy.\r\n\t\t\t\r\n\t\t\r\n\t\r\n\t\r\n\nHơi nhầm\r\nEm này ko phải Hoàng Anh bambi nhé\r\nHoàng ANh bambi sn90 trước học cấp 3 thăng long sau học rmit nhé"
